import React from "react";
import { useHistory } from "react-router-dom";

export default function App() {
  const history = useHistory();

  function navigateToHome() {
    history.push("/");
  }

  return (
    <div className="App">
      <h1>Hello react</h1>
      <button onClick={navigateToHome}>Home</button>
    </div>
  );
}
